import { withCookies } from 'react-cookie';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');

class SendImage extends Component {
	sendImage = () => {
		const client = new AccountClient('http://192.168.43.23:8080');
		const request = new imageData();
		request.setImage('');
		request.setIndex(1);
		const uid = this.props.cookies.get('uid');
		const temp = this.props.cookies.get('session_id');
		const metadata = {
			'user_id': uid,
			'session_id': temp
		}
		console.log('aa');
		client.updateImage(request, metadata, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				// console.log(reply.getMessage());
			}
		})
	}

	componentDidMount() {
		this.sendImage();
	}

	render() {
		return (
			<div></div>
		)
	}
}

export default withCookies(SendImage);
